import '../css/page/opidex.css';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

function OpiDex() {
  return (
    <div className="opidex">
       <Box sx={{ width: '100%' }}>
      <Stack spacing={2}>
        <TextField
          required
          id="outlined-required"
          label="Required"
          defaultValue="Hello World"
        />

       </Stack>
    </Box>
    </div>
  );
}

export default OpiDex;
